import "../App.css";

function BlogEntry() {
  function BlogPosts({ BlogPost }) {
    const blogPosts = blogPosts.map((blogPost) => {
      return (
        <ul>
          <li key={blogPost.blogPost}>
            <p>{blogPost.body}</p>
          </li>
        </ul>
      );
    });
  }

  return (
    <div className="post-wrapper">
      <h1 className="post-title">Welcome to Explore Edinburgh(test)</h1>
      <p className="post-datetime">14th September 2020, 14:26</p>
      <p className="post-body">
